import React from 'react'
import { Link } from 'react-router-dom'

export default function PokemonsCard({name, type}) {

  return (
    
    <div>
      
       <h3>{props.name.toUpperCase()}</h3>
      <img src={props.image} alt="Img Not Found" width="150" height="150"/>
      {props.type.map(type => <h3> {type.type} </h3>)}
     
    </div>
  )
}
